import { useEffect } from "react";

import Header from "./Header";
import {getData} from '../api';


function App() {

  useEffect(() => {
    async ()=>{
      let data = await getData();
      console.log(data, 'hey');
    }

  }, []);

  return (
    <div className="App">
      <Header />
    </div>
  );
}

export default App;
